import './Buscar.css'

import lupa from '/home/leonardo/Destiny/destiny/src/lupa.png'

export default function Buscar({ handleChangeSearchValue, value }) {
    return (
        <div className="buscar">
            <input onChange={handleChangeSearchValue} type="text" placeholder="O que deseja buscar?" value={value}/>
